DATA[THIS_TYPE]["OPTIMIZE"] = function(PARTS) {
	var filter = ["SCREEN","TS1A","TS2A","TS3A","TS4A","TS5A","TS6A","ACC","SIDEACC","LS32","GUNMODE","SIDES","B1TBAR","B1S2AC","B1S2A1","FLAPS","WHEEL","B2EXT","B4CEND","B5C2"]
	var NEW_PARTS = []
	var exclude = false
	for (let i = 0; i < PARTS.length; i++) {
		exclude = false
		for (let j = 0; j < filter.length; j++) {
			if (PARTS[i].toUpperCase().includes(filter[j])) {
				exclude = true
				break
			}
		}
		if (!exclude) {
			NEW_PARTS.push(PARTS[i])
		}
	}
	PARTS = NEW_PARTS
	return NEW_PARTS
}

